var gotoTop = {
	id: "#gotop",
	bottomId: "#c_goBot",

	wrap: document.getElementById("costom"),
	timmer: null,
	fps: 50,
	startTime: null,
	duration: 1000,
	toggleTimer: null,
	preAnimate: null,
	clickMe: function() {
		var a = document.documentElement.scrollTop || document.body.scrollTop;
		new Animate(window, "scrollTop", {
			from: a,
			to: 0,
			time: 500
		}).start()
	},
	goBottom: function() {
		var c = 0;
		var a = 0;
		var b = 0;
		if (document.documentElement && document.documentElement.scrollTop) {
			c = document.documentElement.scrollTop
		} else {
			if (document.body) {
				c = document.body.scrollTop
			}
		}
		if (document.body.clientHeight && document.documentElement.clientHeight) {
			a = (document.body.clientHeight < document.documentElement.clientHeight) ? document.body.clientHeight: document.documentElement.clientHeight
		} else {
			a = (document.body.clientHeight > document.documentElement.clientHeight) ? document.body.clientHeight: document.documentElement.clientHeight
		}
		b = Math.max(document.body.scrollHeight, document.documentElement.scrollHeight);
		new Animate(window, "scrollTop", {
			from: c,
			to: b - a,
			time: 500
		}).start()
	},
	toggleMe: function() {
		var a = document.documentElement.scrollTop || document.body.scrollTop;
		var b = $(".m-search").getStyle("margin-top");
		if (a >100) {
			$("#gotop").show();
			$("#c_goBot").hide();
			$("#js_mailLogin").hide();
			$("#js_eMailList").hide();
			$("#js_eMail").removeClass("e-mailActived");
			$("#wrap").hasClass("m-fixed",function(g) {
				if (!g) {
					$("#wrap").addClass("m-fixed")
				}
			});
		} else {
			$("#c_goBot").show();
			$("#gotop").hide();
			$("#wrap").removeClass("m-fixed")
		}
	},
	init: function() {
		$(this.id).on("click",
		function() {
			gotoTop.clickMe();
			return false
		});
		$(this.bottomId).on("click",
		function() {
			gotoTop.goBottom();
			return false
		});
		gotoTop.toggleMe();
		$(window).on("scroll",
		function() {
			window.clearTimeout(gotoTop.toggleTimer);
			gotoTop.toggleTimer = window.setTimeout(function() {
				gotoTop.toggleMe()
			},
			200)
		});
		$(window).on("resize",
		function() {
			window.clearTimeout(gotoTop.toggleTimer);
			gotoTop.toggleTimer = window.setTimeout(function() {
				gotoTop.toggleMe()
			},
			200)
		})
	}
};
gotoTop.init();

